        function ez_popup(title,message,type,width){  
        	if( !width )width = 200;
        	temp = '<div class="modal  fade popup_ez" tabindex="-1" role="dialog" aria-labelledby="myModalLabel" aria-hidden="true">'
				      +'<div class="modal-dialog" style="width: '+width+'px;">'
				        +'<div class="modal-content">'
				          +'<div class="modal-header">'
				            +'<button type="button" class="close" data-dismiss="modal" aria-label="Close"><span aria-hidden="true">&times;</span></button>'
				            +'<h4 class="modal-title" id="myModalLabel"></h4>'
				          +'</div>'
				          +'<div class="modal-body">'
				          +'</div>'
				        +'</div>'
				      +'</div>'
				    +'</div>';
			// jQuery('.popup_ez'+key_popup_ez).remove();	    
			jQuery("body").append(temp);	    
        	op = ".popup_ez";
            jQuery(op).find(".modal-header").removeClass("message-warning").removeClass("message-primary").removeClass("message-success").removeClass("message-error").addClass("message-"+type);
            jQuery(op).find(".modal-header h4").html( title );
            jQuery(op).find(".modal-body").html( message );
            jQuery(op).modal('show');
             jQuery('.popup_ez').on('hide.bs.modal', function (e) { 
             	jQuery("body").removeClass('modal-open');
			  	jQuery('.popup_ez').remove();

			}); 
        } 

        function ez_confirm(callback){
        	try{
        		$('.confirm_ez').modal('hide');
        	}catch(err){

        	} 
        	jQuery('.confirm_ez').remove();
            console.log(callback);
            if(callback.mgs2!=''){
                temp = '<div class="modal fade confirm_ez bs-example-modal-sm"   tabindex="-1" role="dialog" aria-labelledby="myModalLabel" aria-hidden="true">'
				      +'<div class="modal-dialog modal-sm">'
				        +'<div class="modal-content" >' 
				          +'<div class="modal-body"  >' 
                          +'<div class="ttle" style="font-size: 18px;"></div>'
                          +'<div class="ttle2" style="font-size: 11px;"></div>'
                          +'<div class="reasion"><textarea class="reasion-content" style="margin: 0px; width: 257px; height: 56px;"></textarea></div>'
				          +'</div>'  
				          +'<div class="modal-footer" style="padding: 6px 20px 9px;background: rgba(0, 137, 255, 0.11);">' 
				            +'<button type="button" class="btn btn-primary yes_confirm_ez" data-dismiss="modal" style="display:none;">YES</button>'
				            +'<button type="button" class="btn btn-default no_confirm_ez" data-dismiss="modal">NO</button>'
				          +'</div>'  
				        +'</div>'
				      +'</div>'
				    +'</div>';
            }
            if(callback.mgs2 =='') {
                temp = '<div class="modal fade confirm_ez bs-example-modal-sm"   tabindex="-1" role="dialog" aria-labelledby="myModalLabel" aria-hidden="true">'
				      +'<div class="modal-dialog modal-sm">'
				        +'<div class="modal-content" >' 
				          +'<div class="modal-body"  >' 
                          +'<div class="ttle" style="font-size: 18px;"></div>'                          
				          +'</div>'  
				          +'<div class="modal-footer" style="padding: 6px 20px 9px;background: rgba(0, 137, 255, 0.11);">' 
				            +'<button type="button" class="btn btn-primary yes_confirm_ez" data-dismiss="modal">YES</button>'
				            +'<button type="button" class="btn btn-default no_confirm_ez" data-dismiss="modal">NO</button>'
				          +'</div>'  
				        +'</div>'
				      +'</div>'
				    +'</div>';
            }
        	
			jQuery("body").append(temp);
				     
        	op = ".confirm_ez"; 
            // jQuery(op).find(".modal-header").removeClass("message-warning").removeClass("message-primary").removeClass("message-success").removeClass("message-error").addClass("message-"+type);
            // jQuery(op).find(".modal-header h4").html( title );
            jQuery(op).find(".ttle").html( callback.mgs );
            jQuery(op).find(".ttle2").html( callback.mgs2 );
            jQuery(op).modal('show');
            jQuery(".yes_confirm_ez").click(function(event){ 
            	event.preventDefault; 
                var str = jQuery(".reasion-content").val();
                //str = str.replace(/(?:(?:^|\n)\s+|\s+(?:$|\n))/g,"").replace(/\s+/g," ");
            	if(callback.ok) callback.ok(str);
            	callback = function(){};  
            });
            jQuery(".no_confirm_ez").click(function(){
            	event.preventDefault;
            	if(callback.cancel) callback.cancel();
            	jQuery(op).modal('hide');  
            });
            jQuery(".reasion-content").keyup(function(){
            	event.preventDefault;
                var str = jQuery(".reasion-content").val();
                 //alert(str);
                str = str.replace(/(?:(?:^|\n)\s+|\s+(?:$|\n))/g,"").replace(/\s+/g," ");
               
                if(str!='')
                {
                    jQuery(".yes_confirm_ez").show();
                }
                else {
                    jQuery(".yes_confirm_ez").hide();
                }
            	
            });
            jQuery('.confirm_ez').on('hide.bs.modal', function (e) {
			  	jQuery('.confirm_ez').remove();
			});  
			jQuery(op).on('hide.bs.modal', function (e) {
			  if(callback.cancel) callback.cancel();
			  jQuery("body").removeClass('modal-open');
			})
        } 

        // function ez_cfinput( message,input,callinput){
        function ez_cfinput( input ){	
        	// console.log(input);
        	var htmlinput = '';
        	jQuery.each(input.input,function(name,vl){
        		var type   		= (typeof(vl.type) == 'undefined' )?'text':vl.type;
        		var idm    		= (typeof(vl.id) == 'undefined' )?'':vl.id;
        		var classm    	= (typeof(vl.class) == 'undefined' )?'':vl.class;
        		var width  		= (typeof(vl.width) == 'undefined' )?'100%':vl.width;
        		var height  	= (typeof(vl.height) == 'undefined' )?'100%':vl.height; 
        		var label  		= (typeof(vl.label) == 'undefined' )?name:vl.label; 
        		var value  		= (typeof(vl.value) == 'undefined' )?0:vl.value;
        		
        		var placeholder = (typeof(vl.placeholder) == 'undefined' )?'':vl.placeholder;
        		if( type.toUpperCase() == 'SELECT' ){
        			var option      ='';
        			// console.log(value);
	        		jQuery.each(vl.option,function(key,m){  
	        			if( key == value ){
	        				option += '<option selected>'+key+'</option>';
	        			}else{
	        				option += '<option >'+key+'</option>';
	        			} 
				  	});	
        			htmlinput += '<div class="form-group">'
							    +'<label for="'+idm+'" class="col-sm-3 control-label text-left">'+label+'</label>'
							    +'<div class="col-sm-8">'
							    	+'<select value="'+value+'" class="'+classm+' form-control" id="ez_cfinput_input'+name+''+idm+'" >'
							    	+ option
							    	+'<select>'
							  	+'</div>'
							  +'</div>';
				}else if( type.toUpperCase() == 'IFRAME' ){
				 	htmlinput +='<iframe class="'+classm+'" height="'+height+'" width="'+width+'" src="'+vl.src+'"></iframe>'		  	
        		}else if( type.toUpperCase() == 'CHECKBOX' ){
        			htmlinput += '<div class="form-group">'
							    +'<label for="'+idm+'" class="col-sm-5 control-label text-left">'+label+'</label>'
							    +'<div class="col-sm-2">'
							    	+'<input  style="width: 20px;height: 20px;"  '+value+'   type="'+type+'" class="'+classm+' form-control" id="ez_cfinput_input'+name+''+idm+'" placeholder="'+placeholder+'">'
							  	+'</div>'
							  +'</div>';
        		}else{
        			htmlinput += '<div class="form-group">'
							    +'<label for="'+idm+'" class="col-sm-3 control-label text-left">'+label+'</label>'
							    +'<div class="col-sm-8">'
							    	+'<input   value="'+value+'"  type="'+type+'" class="'+classm+' form-control" id="ez_cfinput_input'+name+''+idm+'" placeholder="'+placeholder+'">'
							  	+'</div>'
							  +'</div>';
        		}
        		 


        	});
        	temp = '<div class="modal fade ez_cfinput "   tabindex="-1" role="dialog" aria-labelledby="myModalLabel" aria-hidden="true">'
				      +'<div class="modal-dialog modal-sm">' 
				        +'<div class="modal-content" >' 
			        	  +'<div class="modal-header message-primary" style="padding: 12px 5px 4px 20px !important;">'
				            +'<button type="button" class="close" data-dismiss="modal" aria-label="Close"><span aria-hidden="true">&times;</span></button>'
				            +'<h4 class="modal-title"  >'+input.mgs+'</h4>'
				          +'</div>'	
				          +'<div class="modal-body" style="padding: 8px;" >' 
				          +htmlinput 
				          +'</div>'  
				          +'<div class="modal-footer" style="padding: 6px 20px 9px;">' 
				            +'<button type="button" class="btn btn-primary yes_ez_cfinput" data-dismiss="modal">OK</button>'
				            //+'<button type="button" class="btn btn-default no_confirm_ez" data-dismiss="modalcallgetinput">NO</button>'
				          +'</div>'  
				        +'</div>'
				      +'</div>'
				    +'</div>';
			jQuery("body").append(temp);
			op = ".ez_cfinput";
			jQuery(op).modal('show');
			 
			jQuery(".yes_ez_cfinput").click(function(event){ 
            	event.preventDefault;
            	var kq = {}; 
            	jQuery.each(input.input,function(name,vl){
            		if( vl.type == 'checkbox'){
            			kq[name] = (jQuery("#ez_cfinput_input"+name).is(':checked'))?1:0 ;
            		}else{
            			kq[name] = jQuery("#ez_cfinput_input"+name).val();
            		}
            	});
            	kqr = kq;
            	input.ok(kqr);
            	input.ok= function(){};  
            });
            jQuery('.ez_cfinput').on('hide.bs.modal', function (e) {
            	if(input.cancel)
            	input.cancel();
			  	jQuery('.ez_cfinput').remove();
			  	jQuery("body").removeClass('modal-open');
			});  
        }

